  \"Physics-based selection of SLM process parameters to mitigate defects and to control
  deposit microstructure Project\",\n\t\"tracking_summary\": {\n\t\t\"total\": 14,\n\t\t\"recent\":
  2\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\": [],\n\t\"revision_timestamp\":
  \"2015-05-06T22:12:25.479766\",\n\t\"name\": \"physics-based-selection-of-slm-process-parameters-to-mitigate-defects-and-to-control-depos\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"The research objectives of this proposal
  are to: (1) To adapt the thermal-fluid science procedures for the prediction of
  weld defects to the prediction and control of surface defects and melt pool instability
  during the deposition of single tracks in SLM and to control the as-deposited microstructure.
  (2) Utilize physics-based analysis to predict variability caused in the individual
  SLM track cross-section geometry due to the statistical distribution of powder particles
  sizes and the potential non-uniform placement of powder particles during recoating.
  This will also include performing statistical analysis of the variability and to
  develop a probabilistic model to calculate levels of confidence and exceedance for
  the size and type of potential defects as a function of the SLM process parameters.
  (3) Determine the thermal cycling during deposition and use it to predict solidification
  microstructure and solid state transformations during deposition; and (4) Demonstrate
  feasibility of the analytical procedures for alloy IN718.\",\n\t\"license_title\":
